import { useContext, useState } from "react";
import cartContext from "../../store/use-context";
import { Form } from "react-router-dom";
import UseInput from "../../hooks/UseInput";

const CheckOutDetails = () => {
    const [paymentMethod, setPaymentMethod] = useState("cash");
    const {
        value: nameValue,
        onChange: nameOnChangeHandler,
        onBlur: nameOnBlurHandler,
        inputIsValid: nameInputIsValid,
        inputHasError: nameInputHasError
    } = UseInput(value => value.trim().length > 3);

    const {
        value: addressValue,
        onChange: addressOnChangeHandler,
        onBlur: addressOnBlurHandler,
        inputIsValid: addressInputIsValid,
        inputHasError: addressInputHasError
    } = UseInput(value => value.includes("Street"));

    const {
        value: cartHolderValue,
        onChange: cartHolderOnChangeHandler,
        onBlur: cartHolderOnBlurHandler,
        inputIsValid: cartHolderInputIsValid,
        inputHasError: cartHolderInputHasError
    } = UseInput(value => value.trim().length > 5);

    const {
        value: cartNumberValue,
        onChange: cartNumberOnChangeHandler,
        onBlur: cartNumberOnBlurHandler,
        inputIsValid: cartNumberInputIsValid,
        inputHasError: cartNumberInputHasError
    } = UseInput(value => value.trim().length === 12);

    const {
        value: cartExpiryDateValue,
        onChange: cartExpiryDateOnChangeHandler,
        onBlur: cartExpiryDateOnBlurHandler,
        inputIsValid: cartExpiryDateInputIsValid,
        inputHasError: cartExpiryDateInputHasError
    } = UseInput(value => value.includes("/") && value.trim().length === 5);

    const {
        value: cartCodeValue,
        onChange: cartCodeOnChangeHandler,
        onBlur: cartCodeOnBlurHandler,
        inputIsValid: cartCodeInputIsValid,
        inputHasError: cartCodeInputHasError
    } = UseInput(value => value.trim().length === 3);

    const { setCheckOut, cartItems } = useContext(cartContext)
    function paymentMethodHandler(event) {
        setPaymentMethod(event.target.value);
    }

    function editOrderHandler() {
        setCheckOut(false)
    }

    async function sendOrderToDataBase() {
        const response = await fetch("https://players-c7f1b-default-rtdb.firebaseio.com/products/order.json", {
            method: "POST",
            body: JSON.stringify([
                { order: cartItems.items, price: cartItems.totalPrice },
            ]),
            headers: {
                "Content-Type": "application/json"
            }
        });

        if (!response.ok) {
            throw { message: "Order could not be sent" }
        }
    };

    function sendOrderHandler() {
        sendOrderToDataBase()
    }
    return (
        <Form>
            <div>
                <label htmlFor="name">Full name: </label>
                <input value={nameValue} onChange={nameOnChangeHandler} onBlur={nameOnBlurHandler} name="name" id="name" type="text" placeholder="Joe Doe..." required />
            </div>
            <div>
                <label htmlFor="address">Address: </label>
                <input value={addressValue} onChange={addressOnChangeHandler} onBlur={addressOnBlurHandler} name="address" id="address" type="text" placeholder="Street name and number..." required />
            </div>
            <div>
                <label htmlFor="payment">Payment: </label>
                <select value={paymentMethod} name="payment-method" onChange={paymentMethodHandler} defaultValue="cash">
                    <option value="cash">Cash</option>
                    <option value="cart">Cart</option>
                </select>
                {paymentMethod === "cart" &&
                    <div>
                        <div>
                            <label htmlFor="name">Cart Holder: </label>
                            <input value={cartHolderValue} onChange={cartHolderOnChangeHandler} onBlur={cartHolderOnBlurHandler} name="cart-holder" id="name" type="text" placeholder="Joe Doe..." required />
                        </div>
                        <div>
                            <label htmlFor="cart-number">Cart Number: </label>
                            <input value={cartNumberValue} onChange={cartNumberOnChangeHandler} onBlur={cartNumberOnBlurHandler} name="cart-number" id="cart-number" type="text" placeholder="4719 7838 8973 3778" required />
                        </div>
                        <div>
                            <label htmlFor="cart-expiry-date">Expires: </label>
                            <input value={cartExpiryDateValue} onChange={cartExpiryDateOnChangeHandler} onBlur={cartExpiryDateOnBlurHandler} name="cart-expiry-date" id="cart-expiry-date" type="text" placeholder="03/26" required />
                        </div>
                        <div>
                            <label htmlFor="cart-code">Code: </label>
                            <input name="cart-code" id="cart-code" type="password" placeholder="***" required />
                        </div>
                    </div>}
            </div>
            <div>
                <button onClick={editOrderHandler}>Go Back</button>
                <button onClick={sendOrderHandler}>Finish order</button>
            </div>
        </Form>
    )
};

export default CheckOutDetails;
